import React from 'react';
import {Component} from 'react';
import './operand.css';
function Operator(){
  return (
  <div className="operand">
    <div>1</div>
    <div>2</div>
    <div>3</div>
    <div>4</div>
    <div>5</div>
    <div>6</div>
    <div>7</div>
    <div>8</div>
    <div>9</div>
    <div>*</div>
    <div>0</div>
    <div>#</div>
  </div>
  );
}

export default Operand;
